import * as React from 'react';
import useStyles from './styles'
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import Paper from '@mui/material/Paper';
import TextField from '@mui/material/TextField';
import {useState} from "react";


//
const HomePage = () => {
 const [prediction,setPrediction]=useState()
 const [relativeVelocity,setRelativeVelocity]=useState()
 const [missDistance,setMissDistance]=useState(-1)
 const [estdDiameter,setEstDiameter]=useState(-1)
 const [absoluteMagnitude,setAbsoluteMagnitude]=useState(-1)
 const classes=useStyles();
//  function makePredication(e){
//     //api call
  
  
//   }
  return (
    <div>
        <Box sx={{ flexGrow: 1 }}>
        <Grid container spacing={2} sx={{textAlign:"center"}}>
            <Grid item xs={12}>
               <img src="nasa.png" alt="logo" style={{marginTop:"5px"}}/>
            </Grid>
            <Grid item xs={12} sx={{textAlign:"center"}} >
                <Box sx={{ 
                  maxWidth: 700,
                  maxHeight: 700,
                  marginLeft:"auto",
                  marginRight:"auto",
                  }}>
                  <Paper elevation={12} sx={{padding:"30px"}}>
                    <Typography variant="h5" component="h2" sx={{padding:"10px"}}>
                      Find Out Whether An Aestroid is Hazardous or Not
                    </Typography>
                    <TextField sx={{margin:"10px"}}id="outlined-basic" label="Relative Velocity" variant="outlined"  value={relativeVelocity} onChange={(event)=>setRelativeVelocity(event.target.value)}/>
                    <TextField sx={{margin:"10px", }}id="outlined-basic" label="Absolute Magnitude" variant="outlined" />
                    <TextField sx={{margin:"10px", }}id="outlined-basic" label="Estimated Diameter" variant="outlined" />
                    <TextField sx={{margin:"10px", }}id="outlined-basic" label="Missed Distance" variant="outlined" /><br/>
                    <Button sx={{marginTop:"10px"}} variant="contained">Find Out</Button>
                    <Typography variant="h5" sx={{marginTop:"20px"}}>Hazardous</Typography>
                    {/* onChange={(event)=>setName(validatedInput(event.target.value))} */}
                  </Paper>

                </Box>
            </Grid>
        </Grid>
        </Box>
    </div>


  )
}

export default HomePage
